import React from "react";
import {Link} from "react-router-dom";
import {Button} from "react-bootstrap";

function Home() {
  return(
    <div className="home">
      <h1>Welcome to Wizz!</h1>
      <p>
        <Link to="/signup"> Sign Up </Link>
      </p>
      <p>
        <Link to="/login"> Log In </Link>
      </p>
    </div>
  );
}

export default Home;
